import { useLocation } from "react-router-dom";
import BotaoPrecisao from "../compontente/BotaoPrecisao/BotaoPrecisao";
import Cabecalho from "../compontente/Cabecalho/Cabecalho";
import Estante from "../compontente/Estante/Estante";
import "./TelaEstante.css";
import { useEffect, useState } from "react";
import axios from "axios";
import Livro from "../compontente/Livro/Livro";

function TelaEstante() {
  

  const [Estantes, setEstantes] = useState([{}]);

  useEffect(() => {
    axios
      .get("http://localhost:8080/map")
      .then((resposta) => {
        setEstantes(resposta.data);
      })
      .catch((error) => {
        console.log(error);
      });
  }, []);

  return (
    <>
      <Cabecalho />
      <div className="TelaEstante">
        {Estantes.map((conteudo, i) => {
         
         console.log(conteudo.books)

          if (conteudo.books == "") {
            return (
              <Estante
                x={conteudo.x}
                y={conteudo.y}
                r={conteudo.rotate}
                h={conteudo.height}
                w={conteudo.width}
                c="red"
              />
            );
          }else{
            if(conteudo.books == null){
            return (
              <Estante
                x={conteudo.x}
                y={conteudo.y}
                r={conteudo.rotate}
                h={conteudo.height}
                w={conteudo.width}
                c="green"
              />
            );
          }
          }
        })}
        <BotaoPrecisao />
      </div>
    </>
  );
}

export default TelaEstante;
